import React from 'react';

import Header from '../components/Header';
import Footer from '../components/Footer';

const Explorar = () => (
  <div>
    <Header />
    <div main-explore>
      <button
        type="button"
      >
        Explorar Comidas
      </button>
    </div>
    <Footer />
  </div>
);

export default Explorar;
